INSERT INTO `lomba_kontens` (`id`, `lomba_id`, `judul`, `konten`, `tipe`, `pdf`, `created_at`, `updated_at`, `link`, `image`) VALUES
(2, 2, 'JAKARTA OPEN PIANO COMPETITION 2023', '<p>Jakarta Open Piano Competition has been established since more than 10 years ago and has become one of the most outstanding piano competition in Indonesia. Many successful pianists have witnessed the wellness and the importance of the competition in their musical journey, both nationally and internationally.&nbsp;</p><p>Opus Nusantara is honoured to invite you all young musicians to join this particular event of JOPC 2023.&nbsp;<br>The winners of Kompetisi Piano Pelajar 2023 are invited exclusively to join directly to the final round.&nbsp;</p><p>Be our guests..</p><p><b>CLICK</b> these for competition\'s <a href=\"https://firebasestorage.googleapis.com/v0/b/jtgfastxopus.appspot.com/o/Ketentuan%20Kompetisi%20Lengkap%20Repertoire%20Revised.pdf?alt=media&amp;token=748f76c9-8d7c-4419-83cd-c9749b62ed8d\"><u><b>REGULATIONS</b></u></a> &amp;&nbsp;<a href=\"https://firebasestorage.googleapis.com/v0/b/jatengfast-f550f.appspot.com/o/Repertoar.pdf?alt=media&amp;token=22bed1a5-d47f-45dd-b88b-7066e52a67f9\"><u><b>REPERTOIRES</b></u></a></p><p><b>CLICK</b> this for the competition&nbsp;<a href=\"https://firebasestorage.googleapis.com/v0/b/jatengfast-f550f.appspot.com/o/Hasil%20Kategori%20ABCDE%20complete%20(1).pdf?alt=media&amp;token=9d1453cf-5371-44db-8308-78c917c45cb8\" target=\"_blank\"><b><u>RESULT</u></b></a><br></p><p><br></p>', 'html', NULL, '2023-07-14 04:49:28', '2024-01-17 14:59:15', NULL, NULL),
(4, 4, 'Kompetisi Piano Pelajar 2024 SEMARANG', '<p>Kompetisi Piano Pelajar (KPP) merupakan agenda tahunan Opus Nusantara yang sudah berlangsung selama 10 tahun terakhir. Ajang ini merupakan mencari bakat musik khususnya piano anak-anak muda yang sangat potensial. Banyak sekali pianis muda yang lahir dari rahim KPP ini sehingga bisa bersaing di level Internasional maupun memasuki sekolah-sekolah musik internasional.<br></p><p>Acara ini akan diselenggarakan antar sekolah untuk anak yang duduk di bangku SD, SMP dan SMA atau sederajat.</p><p>Be our guests..</p><p>Klik di sini untuk&nbsp;<a href=\"https://firebasestorage.googleapis.com/v0/b/jtgfast.appspot.com/o/Syarat%20ketentuan%20%26%20repertoire%20kop%20KPP%202024.pdf?alt=media&amp;token=c5382d9c-1d4a-4580-9459-e6b31bc14298\"><u><span style=\"font-weight: 600;\">Syarat &amp; Ketentuan</span></u></a></p><p>Klik di sini untuk&nbsp;<a href=\"https://firebasestorage.googleapis.com/v0/b/jtgfastxopus.appspot.com/o/Repertoire%20Pilihan%20KPP%202024.pdf?alt=media&amp;token=cb4faed2-6a11-43f9-890d-ae4e295503e4\" target=\"_blank\"><span style=\"font-weight: 600;\"><u>Repertoar</u></span></a></p><p>Partitur kategori A pilihan klik&nbsp;<a href=\"https://drive.google.com/drive/folders/1nK4ZUhs9XUvhkarP5feiuZWIa7EuV62m?usp=drive_link\"><span style=\"font-weight: 600;\"><u>di sini</u></span></a></p><p>Partitur kategori B pilihan klik&nbsp;<a href=\"https://drive.google.com/drive/folders/1njkjDNo7phFdteAV0jrzZe57CctCzhMg?usp=drive_link\" target=\"_blank\"><u><span style=\"font-weight: 600;\">di sini</span></u></a></p><p>Partitur kategori C pilihan klik&nbsp;<a href=\"https://drive.google.com/drive/folders/1fuOT1tJKJXul1J7TMRHriutlyseeOcL5?usp=drive_link\"><u><span style=\"font-weight: 600;\">di sini</span></u></a></p><p>Partitur kategori D pilihan klik&nbsp;<a href=\"https://drive.google.com/drive/folders/1C3UlcIj5vCtRWr-Td4CBv-rFUg7xh9Rm?usp=drive_link\" target=\"_blank\"><span style=\"font-weight: 600;\"><u>di sini</u></span></a></p><p>Partitur kategori E pilihan klik&nbsp;<a href=\"https://drive.google.com/drive/folders/1iWVt03RtNXIS5faZQkemLme1pvRITBtm?usp=drive_link\" target=\"_blank\"><span style=\"font-weight: 600;\"><u>di sini</u></span></a></p><p>Partitur kategori F pilihan klik&nbsp;<a href=\"https://drive.google.com/drive/folders/10OTHRoiwCo0aRmypb7z6TRDyC_8qmKcY?usp=drive_link\"><u><span style=\"font-weight: 600;\">di sini</span></u></a></p><p>Pendaftaran KPP seri Semarang akan dibuka pada&nbsp;<span style=\"font-weight: 600;\"><u>21 Februari 2024</u></span><br></p><div><span style=\"font-weight: 600;\"><u><br></u></span></div>', 'html', NULL, '2024-02-17 06:47:59', '2024-03-12 09:17:27', NULL, NULL),
